Altersunterschiede und Generationskonflikte sind nichts Unübliches 😕. Doch wir von ArtNight sind immer wieder aufs neue beeindruckt, wie viele Individuen auf unseren Malabenden zusammentreffen. Dabei spielt das Alter die kleinste Rolle. Denn letztendlich wollen wir alle in guter Gesellschaft sein, einen tollen Abend mit ein paar Drinks genießen und den Pinsel schwingen.🎨🥂❤️👨🏻‍🎨
Egal ob jung oder alt, wir von ArtNight befürworten Diversität in allen Bereichen.🕺🏽 Oftmals leben junge Leute mit der Befürchtung, dass sie für gewisse Aktivitäten zu jung, zu unreif oder zu naiv sind. Ebenso denken unsere Best Ager, dass sie für viele Aktivitäten zu alt sind und von den jüngeren Generationen ausgelacht werden...🥺🤷🏼‍♀️ Es gibt jedoch immer Beispiele, die uns eines besseren Belehren: 
@hgvolckmer ! Was wir von unserem ältesten ArtNight Künstler lernen können? Niemals sein Alter vor irgendwelche Aktivitäten stellen. Du hast Lust drauf? Dann mach es!💪🏼✨ #myartnight #artnightevents #bestager #hansgerd
